import './App.css';
import {useEffect, useState} from "react";
import axios from "axios";
import PostList from "./component/PostList/Post.List";

function App() {
    const [post, setPost] = useState([]);
    useEffect(() => {
        const response = axios.get("https://jsonplaceholder.typicode.com/posts?_limit=10&_page=1").then(() =>{
            setPost(response.data)
        })
    }, [])

    return (
        <div className="App">
            <PostList />
        </div>
    );
}

export default App;
